syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";

import "PbNavMeshStatsInfo.proto";

message NavMeshStatsNotify {
	enum CmdId {
		option allow_alias = true;
		ENET_CHANNEL_ID = 0;
		NONE = 0;
		ENET_IS_RELIABLE = 1;
		IS_ALLOW_CLIENT = 1;
		CMD_ID = 2355;
	}

	repeated PbNavMeshStatsInfo infos = 1;
}
